  const [newMenu, setNewMenu] = useState("");

  return (
    <div>
      <div>
        <button onClick={wywołaj}>Add Expense</button>
      </div>
    </div>
  );

  function wywołaj() {
    setNewMenu(<ChangeMenu />)
    
    return newMenu;
    
  }
}
export default ExpenseForms;
